import React from 'react';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import GetAllGenres from './GetAllGenres';

const FullGenreList = () => {
  return (
    <Grid
      style={{
        padding: '50px',
        textAlign: 'center',
        marginBottom: '40px'
      }}
    >
      <Typography
        sx={{
          fontSize: '30px',
          marginBottom: '10px',
          fontWeight: 'bold',
          color: '#665A48',
        }}
      >
        Browse All Genres
      </Typography>
      <GetAllGenres short={false}/>
    </Grid>
  )
}

export default FullGenreList
